package org.apache.commons.collections4.iterators;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertThrows;

import java.util.NoSuchElementException;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

public class ObjectArrayIterator_nextTest {

    private ObjectArrayIterator<String> iterator;
    private String[] testArray = {"One", "Two", "Three"};

    @BeforeEach
    public void setUp() {
        iterator = new ObjectArrayIterator<>(testArray);
    }

    @Test
    public void testNextWithElements() {
        assertEquals("One", iterator.next());
        assertEquals("Two", iterator.next());
        assertEquals("Three", iterator.next());
    }

    @Test
    public void testNextWithoutElements() {
        iterator = new ObjectArrayIterator<>(new String[0]);
        assertThrows(NoSuchElementException.class, () -> {
            iterator.next();
        });
    }

    @Test
    public void testNextAfterReset() {
        assertEquals("One", iterator.next());
        iterator.reset();
        assertEquals("One", iterator.next());
    }

    @Test
    public void testNextWithCustomStartIndex() {
        iterator = new ObjectArrayIterator<>(testArray, 1);
        assertEquals("Two", iterator.next());
        assertEquals("Three", iterator.next());
    }

    @Test
    public void testNextWithCustomRange() {
        iterator = new ObjectArrayIterator<>(testArray, 1, 2);
        assertEquals("Two", iterator.next());
        assertThrows(NoSuchElementException.class, () -> {
            iterator.next();
        });
    }
}
